var React = require("react")
var d3 = require("d3")

var TableBar = (props) => {
    return (
      <table className ="table">
        <tbody>
          {
            props.rows !== undefined ? props.rows.map((row, i) =>
              <tr key = {"row"+i}>
                  <td key = {row.key}>{row.key} </td>
                  <td key = {i}> {
                    console.log(row.value)
                    // row.value.map((d, i) =>
                    //   console.log(d)
                    //   )
                  } </td>
              </tr>
              ) : null
          }
        </tbody>

      </table>
      )
   }

export default TableBar
